import React from 'react';

const Userdata = () => {
  fetch('https://jsonplaceholder.typicode.com/users')
    .then((res) => {
      return res.json();
    })
    .then((data) => {
      return console.log(data);
    });
  return <div>Userdata</div>;
};

export default Userdata;
